from sortedcontainers import SortedList


class Solution:
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        return sliding_window_solution(s, minJump, maxJump)


def two_pointers_solution(s: str, minJump: int, maxJump: int) -> bool:
    visited = [False for _ in s]
    visited[0] = True
    j = 0
    for i in range(len(s)):
        if not visited[i]:
            continue
        for j in range(max(j, i + minJump), min(len(s), i + maxJump + 1)):
            if s[j] == '0':
                visited[j] = True
    return visited[-1]


def binary_search_solution(s: str, minJump: int, maxJump: int) -> bool:
    N = len(s)

    sl = SortedList()
    sl.add(0)

    for index in range(1, N):
        if s[index] == '1':
            continue

        lindex = sl.bisect_left(index - maxJump)
        if 0 <= lindex < len(sl) and sl[lindex] + minJump <= index:
            sl.add(index)
    return N - 1 in sl


def sliding_window_solution(s: str, minJump: int, maxJump: int) -> bool:
    dp = [False for _ in s]
    dp[0] = True
    cnt = 1
    for i in range(minJump, len(s)):
        if s[i] == "0" and cnt > 0:
            dp[i] = True
        if i - maxJump >= 0 and dp[i - maxJump]:
            cnt -= 1
        if dp[i - minJump + 1]:
            cnt += 1
    return dp[-1]


def dp_solution(s: str, minJump: int, maxJump: int) -> bool:
    dp = [False for _ in s]
    dp[0] = True
    for i in range(minJump, len(s)):
        if s[i] != '0':
            continue
        for j in range(max(i - maxJump, 0), i - minJump + 1):
            if dp[j]:
                dp[i] = True
                break
    return dp[-1]


if __name__ == '__main__':
    print(False, Solution().canReach('01101110', 2, 3))
    print(True, Solution().canReach('011010', 2, 3))
    print(False, Solution().canReach(
        '',
        1, 49999))
